", "finding_aid_filing_title": "Rockefeller Foundation records, projects, RG 1.3", "created_by": "admin", "last_modified_by": "battalb", "create_time": "2014-12-06T10:53:48Z", "system_mtime": "2018-09-18T18:45:31Z", "user_mtime": "2018-09-18T18:45:31Z", "suppressed": false, "id_0": "FA388", "language": "eng", "level": "subgrp", "finding_aid_description_rules": "dacs", "finding_aid_status": "under_revision", "jsonmodel_type": "resource", "external_ids": [{"external_id": "2219", "source": "Archivists Toolkit Database::RESOURCE", "created_by": "battalb", "last_modified_by": "battalb", "create_time": "2018-09-18T18:45:32Z", "system_mtime": "2018-09-18T18:45:32Z", "user_mtime": "2018-09-18T18:45:32Z", "jsonmodel_type": "external_id"}], "subjects": [{"ref": "/subjects/602"}, {"ref": "/subjects/76"}, {"ref": "/subjects/101"}, {"ref": "/subjects/78"}, {"ref": "/subjects/53"}, {"ref": "/subjects/134"}, {"ref": "/subjects/331"}, {"ref": "/subjects/148"}, {"ref": "/subjects/95"}, {"ref": "/subjects/103"}, {"ref": "/subjects/75"}, {"ref": "/subjects/23"}, {"ref": "/subjects/607"}, {"ref": "/subjects/282"}, {"ref": "/subjects/121"}, {"ref": "/subjects/603"}, {"ref": "/subjects/600"}, {"ref": "/subjects/604"}, {"ref": "/subjects/258"}, {"ref": "/subjects/608"}, {"ref": "/subjects/160"}, {"ref": "/subjects/42"}, {"ref": "/subjects/77"}, {"ref": "/subjects/606"}, {"ref": "/subjects/601"}, {"ref": "/subjects/275"}, {"ref": "/subjects/22"}], "linked_events": [], "extents": [{"lock_version": 0, "number": "1", "created_by": "battalb", "last_modified_by": "battalb", "create_time": "2018-09-18T18:45:32Z", "system_mtime": "2018-09-18T18:45:32Z", "user_mtime": "2018-09-18T18:45:32Z", "portion": "whole", "extent_type": "cubic_feet", "jsonmodel_type": "extent"}], "dates": [{"lock_version": 0, "expression": "1910-2000", "begin": "1910", "end": "2000", "created_by": "battalb", "last_modified_by": "battalb", "create_time": "2018-09-18T18:45:32Z", "system_mtime": "2018-09-18T18:45:32Z", "user_mtime": "2018-09-18T18:45:32Z", "date_type": "inclusive", "label": "creation", "jsonmodel_type": "date"}], "external_documents": [], "rights_statements": [], "linked_agents": [{"role": "creator", "relator": "aut", "terms": [], "ref": "/agents/corporate_entities/12"}], "revision_statements": [{"date": "finding aid revision date not supplied", "description": "<date>May 2010, January 2011</date><item>Migrated from Re:discovery to the Archivists' Toolkit by Becky Robbins in May, 2010; Sub RG 1.3, Series 103 added in January, 2011.</item>", "created_by": "battalb", "last_modified_by": "battalb", "create_time": "2018-09-18T18:45:32Z", "system_mtime": "2018-09-18T18:45:32Z", "user_mtime": "2018-09-18T18:45:32Z", "jsonmodel_type": "revision_statement", "uri": "/revision_statement/3402", "repository": {"ref": "/repositories/2"}}], "instances": [], "deaccessions": [], "related_accessions": [], "classifications": [], "notes": [{"jsonmodel_type": "note_multipart", "persistent_id": "7581c8a34b0559d999e9a4f24ce04702", "label": "Biographical/Historical note", "type": "bioghist", "subnotes": [{"jsonmodel_type": "note_text", "content": "The Rockefeller Foundation was established by act of the New York State Legislature approved by the Governor on May 14, 1913, "to promote the well-being of mankind throughout the world." Between 1913 and 1928 the China Medical Board, the International Health Board, and the Division of Medical Education functioned as divisions of the Foundation, concentrating on the administration of programs in public health and medical education. A Division of Studies was created in 1923 to handle projects outside the medical field. These early years were experimental as the new foundation studied the methods of philanthropy and explored its relationships with other Rockefeller boards.

Although the Rockefeller Foundation is the largest and best known philanthropy founded by the Rockefeller family, it was neither the first nor the last to be established. The Rockefeller Institute for Medical Research (1901), the General Education Board (1902), the Rockefeller Sanitary Commission for the Eradication of Hookworm Disease (1909), and the Bureau of Social Hygiene (1911) all existed earlier. When the Foundation was created, the Sanitary Commission was disbanded. After the establishment of the Foundation, the Laura Spelman Rockefeller Memorial (1918) and the International Education Board (1923) were created.

The Rockefeller boards and their programs were reconsidered and reorganized in 1927-1928 in order to avoid overlapping programs. The International Health Board of the Foundation was disbanded and an International Health Division was organized. The China Medical Board, Inc., was established as a separately incorporated institution, and the China Medical Board of the Foundation ceased to exist. The Division of Studies was dropped and the Division of Medical Education was phased out. The Laura Spelman Rockefeller Memorial was combined with the Foundation and the Spelman Fund of New York was chartered to continue activities of the LSRM that were not absorbed by the Foundation. The International Education Board was disbanded.

As a result of this reorganization, the Foundation adopted a program which included public health work (administered by the IHD), the advancement of knowledge in the medical and natural sciences (in part taken over from the IEB), the social sciences (formerly the field of the LSRM), and the humanities and arts (shared with the GEB). The Rockefeller Institute and the Bureau of Social Hygiene were not affected by the reorganization. The program adopted by the Foundation at this time remained basically the same for the next twenty years.

As its files accumulated, the Foundation maintained a card index recording the names of institutional and individual grantees and correspondents. A microfilm copy of this index is available at the Archive Center.

", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "f3a3efb445067434fd47f90f76a9c542", "label": "Arrangement note", "type": "arrangement", "subnotes": [{"jsonmodel_type": "note_text", "content": "The project files are arranged in series according to country. Each state within the United States and every country or geographical area was assigned a three-digit number by RF staff. In addition, the records are further arranged into subseries, designated by letters signifying program areas, for example, "A" indicates a grant in the Medical Sciences program area, and "C" Nursing. Material is organized within these letter/program subdivisions alphabetically by grant title. A grant title usually consists of a heading that includes the name of the institution or individual that received the grant. Thus each grant, or project, is filed individually in one or more folders.


