", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "d452ccc04cb85d6c91af61233fd7a59a", "label": "Conditions Governing Access note", "type": "accessrestrict", "rights_restriction": {"local_access_restriction_type": []}, "subnotes": [{"jsonmodel_type": "note_text", "content": "Records more than 20 years old are open for research with select materials restricted as noted. Brittle or damaged items are available at the discretion of RAC. Researchers interested in accessing digital media (floppy disks, CDs, DVDs, etc.) or audiovisual material (audio cassettes, VHS, etc.) in this collection must use an access surrogate. The original items may not be accessed because of preservation concerns. To request an access surrogate be made, or if you are unsure if there is an access surrogate, please contact an archivist.", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "a42babef87cc68be32cfd0dd97002a70", "label": "Biographical/Historical note", "type": "bioghist", "subnotes": [{"jsonmodel_type": "note_text", "content": "The Rockefeller Foundation opened a field office in Cali, Colombia in 1960, ten years after the establishment of the Colombian Agricultural Program in Bogota. Guy S. Hayes, an Assistant Director in the Medical and Natural Sciences division, held the post of Field Director in Cali from 1960 until 1970. After 1970, the office was headed by Foundation Representatives Patrick N. Owens (1970-1974) and Farzam Arbab (1974-78). The office closed on December 31, 1983.

RF activity in Colombia reflected the broad reorientation of Foundation programming away from Europe and towards the developing world which took place under RF Presidents Dean Rusk (1952-1961) and J. George Harrar (1961-1972). In Latin America, as in Africa and Southeast Asia, the Foundation sought to relieve basic human needs by establishing rural and community development programs, strengthening disease research facilities, and revitalizing universities that they might become more responsive to local populations. The RF approach to development involved the training of local personnel and the strengthening of local institutions through exchange programs with American universities and fellowships support for Colombian scholars.

One of the prime beneficiaries of RF support in Colombia was the Universidad del Valle and its Medical School at Cali, which received assistance under the RF's University Development program (1963-1978). (The program was renamed Education for Development (EFD) in 1974). The Universidad del Valle became one of the best medical schools in Latin America, combining the practice of public health at the Candelaria Rural Health Center with the teaching and practice of medicine. The EFD program was phased out in 1978, with future university grants made within the appropriate RF program areas.", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "14510d68974c5407bfd2244b2f6e19a4", "label": "Arrangement note", "type": "arrangement", "subnotes": [{"jsonmodel_type": "note_text", "content": "The Cali office records are arranged in four series:

Series 1 - Administrative Correspondence;
Series 2 - Universidad del Valle--Academic Programs;
Series 3 - Universidad del Valle--Medical Programs;
Series 4 - Cooperating Universities and Programs.

Within series, files are arranged in the order received, according to an internal numeric system. Retaining the files' original order preserves the usefulness of numerous cross-reference inserts that refer to related files by number. Gaps in the numbering sequence indicate that the office discarded portions of these records prior to their transfer to New York in 1977, 1978, and 1984.

Folders are arranged by file number. File numbers appear in parentheses following folder title.
", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "59c7ff251b7fd4bd6f8460f6d0903430", "label": "Scope and Contents note", "type": "scopecontent", "subnotes": [{"jsonmodel_type": "note_text", "content": "The records (1960-1978) of the Rockefeller Foundation's Cali, Colombia field office, consisting of routine administrative correspondence, document to a limited extent the administration of the RF's Education for Development (EFD) program and other programs undertaken in Colombia by the RF's divisions of Medical and Natural Sciences and Humanities and Social Sciences.

While the focus of the Bogota office was agriculture, the Cali office coordinated programs in rural, community, and university development. Series I contains eight folders concerning the Cali field station of the RF's Virus Research Program (1964-73), a program for research on arthropod-borne (arbo) viruses. The bulk of the collection, located in Series II and III, relates to the development of the University del Valle's Academic and library programs and its medical school under the auspices of the RF's University Development (1963-74) and Education For Development (1974-78) programs. Series IV includes correspondence between the Cali staff and several American universities cooperating with the Universidad del Valle in rural and tropical disease research, preventitive medicine and nutrition, and child and public health.

Correspondents include Farzam Arbab, Ulysses J. Grant, Guy S. Hayes, Robert S. Morison, Patrick N. Owens, Dorothy Parker, Virgil C. Scott, Harold Trapido, John Veenstra, and John M. Weir. Some correspondence is in Spanish.

