", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "467f548799437b1629e30f53d08e759a", "label": "Scope and Contents note", "type": "scopecontent", "subnotes": [{"jsonmodel_type": "note_text", "content": "The Mideast Wheat Research and Training Project records contain general correspondence and administrative documents pertaining to the Turkish wheat stations and the various foundations and institutions connected to wheat research in Turkey during the 1970s. Correspondence, reports, and printed material detail the Center's wheat research work and plant breeding and its interactions with Turkish authorities and with other agricultural institutes and university agronomists. This collection documents the day-to-day work of the Center; for materials regarding the establishment and administration of the Wheat Research Center one should consult the files on Turkish Wheat Research in the Rockefeller Foundation project files, RG 1, Accession 83, Series 105 (804).", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "4b436b85f235f9435aa433c5c493f98b", "label": "Biographical/Historical note", "type": "bioghist", "subnotes": [{"jsonmodel_type": "note_text", "content": "The Mideast Wheat Research and Training program was a project funded by the Rockefeller Foundation to help with crop research and agricultural production in Turkey. The program included breeding of adapted varieties of both spring and winter wheat for various ecological conditions, training for wheat scientists from cooperating countries, and advice and assistance in the development of the local research and production programs. In September 1967 the Rockefeller and Turkey began negotiations for the Rockefeller Foundation to participate in the development of the national wheat program. By July 1, 1970, the Turkish Wheat Research and Training Center had been established. The Rockefeller Foundation agreed to a start-up grant of $100,000, which was to expire at the end of 1968. Rockefeller Foundation funding was extended and renewed through the 1970s. In 1977 the Rockefeller Foundation signed a final three-year extension.

Quality was not considered important at the start of the project. Rather, the point was to produce a large amount of wheat. The project pioneered an approach to the problem of a specific crop.

There were several issues with the Wheat Research Project that quickly became apparent. Initially, only fluent English speakers were eligible for overseas training. As the program developed, staff received English language instruction before going for training, but once abroad they required additional training in order to function effectively and produce. Relations with the Turkish government were also complicated, and issues arose with organization and method. There were also struggles with various governmental departments. These issues were not helped by Turkey's bureaucracy and climate of administrative instability, attributable to constantly changing governments.

Over thirteen years Turkish wheat production increased from around 10 million metric tons to 17 million with general agreement that this increase was largely owing to the wheat improvement project.

Various names were used to refer to the Wheat Research and Training Program, including: Middle East Wheat Improvement Project, Wheat Improvement Project, Wheat Research Program, Mid-East Wheat Research and Training Center, and Ankara Field Office.

Significant staff members include: Ahmet Demirlicakmak, Charles K. Mann, E. E. Saari, Jon Michael Prescott, and Bill C. Wright.", "publish": true}], "publish": true}, {"jsonmodel_type": "note_multipart", "persistent_id": "8299cfa80ed4188f2898dfa9399ee23c", "label": "Conditions Governing Use note", "type": "userestrict", "rights_restriction": {"local_access_restriction_type": []}, "subnotes": [{"jsonmodel_type": "note_text", "content": "RAC users must abide by all applicable provisions of United States copyright law. Reproduction/duplication of archival items is routinely provided in accordance with "fair use." If the RAC does not hold copyright for an archival collection, or items within a collection, it is the user’s responsibility to contact the copyright holder, or make a fair effort to do so, prior to publication.

